import { Layout } from "../../components"
import { AdminCards } from "../../components/parts"
const Admin = () => {
    return (
        <Layout>
            <h2>Admin</h2>
            <div className="input-group m-3">
                <input type="text" className="form-control" aria-label="Default" aria-describedby="inputGroup-sizing-default"/>
            </div>
            <AdminCards />

        </Layout>
    )
}

export { Admin }
